      "NFTS",
      "Discover Artwork",
      Arrow,
      "Supported By",
      Diamond,
      Rhombus,
      "coinbase",
    ],
    NftAuctions: [
      {
        tag: "A",
        day: 74,
        user: "@Mark Rise",
        RemainingTime: "",
        value: 15.97,
        bid: HighestBid,
      },
    ],
  };

  return (
    <>
      <LandingPage content={Contents} />
    </>
  );
};

export default App;
